import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
        <header>GetWord</header>
        <div className='gameContainer'>
            <div>Timer</div>
            <label>Word</label>
            <input p></input>
        </div>

    </div>
  );
}

export default App;
